1993 / pdf / English / 400 pag / Metropoltan / 66.7 MB

The photographs in this book span photography's first century, 1839-1939.

&quot;I stumbled upon this book in New York a few years back and was immediately stunned by its beauty and quality. The Gilman Paper Company apparently started their collection well before the current photography craze and amassed one of the most outstanding collections that you can imagine. Most of these photos are from the very earliest days of the medium and many are in the sepia tone that I personally love. The quality of reproduction is so good that you can actually frame some of the photos! It's astounding...well worth obtaining for any art book collector.&quot;
